  //State
  const [formulario, setFormulario] = useState({
    rut: '',
    nombre: '',
    correo: '',
    carrera: '',
    cantidad: '',
    electivo1: '',
    electivo2: '',
    electivo3: '',
  })
  //Agregar Formulario
  const addForm = (formi) =>{
    setFormulario([
    ...formulario,
        formi
    ])
    }

  return (
      <div className="container">
        <h1>Formulario peticion electivo</h1>
        <div className="flex-row">
          <div className="flex-large">
              <div>
                <h2>Agregar formulario</h2>
               <FormularioAlumno/>
               </div>
          </div>
        </div>
      </div>
  )
}

export default FormularioComponente
